import React from "react";
import { Button, Col, Container, Row, Table } from "react-bootstrap";

function UserDashboard() {
  return (
    <>
      <Container>
        <Row>
          <Col>
            <Button>Request</Button>
          </Col>
          <Col>
            <Table>
              <thead>
                <tr>
                  <th></th>
                </tr>
              </thead>
            </Table>
          </Col>
        </Row>
      </Container>
    </>
  );
}

export default UserDashboard;
